    data: |
      SELECT ALL - col2 / + 36 + + 92 col2 FROM tab2 (FORMAT parquet) WHERE - col2 * + col1 NOT BETWEEN + col0 AND + - col1;
  - name: tab2

outputs:
  - name: q3118.out
    data: |
      91
      91
      92
